        super(props)
    }

    MandanteJogou(dados){
      /*   console.log('estou no mandante')
        console.log('dados são',dados) */
        console.log('props dos mandantes',this.props)
        
    }
    
    _JogadaMandante(elemento){
        console.log('name é',elemento.getAttribute('name'))
    }

    render(){
        
        return (
            
         <ul>
         
             {this.props.cartas.map((cartas,index)=>{
                 return(
                     <li  className="mandante" key={'mandante'+index} onClick={(x)=>this._JogadaMandante(x.target)}>
                    
                         <Card
                          MandanteJogou={this.MandanteJogou}   
                          bandeira={cartas.bandeira}
                           id={cartas.id}
                           país={cartas.país} idh={cartas.idh} exp={cartas.exp}/>
                     </li>
                 )
             })}
             
         </ul>
            
        
       
        ); 
    }

}

export default Mandante;
